    WelcomeContentText,
    WelcomeContentTitle,
    WelcomeText,
    Imge
} from './Paginas.style';
import foto10 from '../../images/foto10.jpg';
import foto1 from '../../images/foto1.jpg';
import HR from '../../images/HR.jpg';
const Paginas = () => {
    return (
        <div>
            <WelcomeContainer>
                <WelcomeContent>
                    <WelcomeImg>
                        <Imge src={foto10} />
                    </WelcomeImg>
                    <WelcomeContentText>
                        <WelcomeContentTitle>BIENVENIDO</WelcomeContentTitle>
                        <WelcomeText>
                        <Imge src={foto10} />
                        </WelcomeText>
                        <WelcomeText>
                          
                        </WelcomeText>
                    </WelcomeContentText>
                </WelcomeContent>
                

            </WelcomeContainer>
            
        </div>
    )
}

export default Paginas;
